INSERT INTO sys_front_locale(id, application_id, application_code, key_code, key_description, language, deleted, version_number, created_by, last_updated_by) VALUES (1106550004967964693,1105012801953902594,'mdata','currency.setting.agreement.5.3','5.3 如用户继续使用自动汇率服务的，即视为同意更新后的协议。融智汇建议用户在使用自动汇率服务之前阅读本协议及公告。如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。','zh_cn',0,1,1,1);
