INSERT INTO sys_front_locale(id, application_id, application_code, key_code, key_description, language, deleted, version_number, created_by, last_updated_by) VALUES (1106550004967964695,1105012801953902594,'mdata','currency.setting.agreement.5.1','5.1 根据国家法律法规变化及运营需要，融智汇有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在本站上即生效，并代替原来的协议。','zh_cn',0,1,1,1);
